Steam Tables calculates the functions below, using the IAPWS-97 equations:

•Function(p,t) – to calculate properties from pressure and temperature;
•Function(p,h) – to calculate properties from pressure and enthalpy;
•Function(p,s) – to calculate properties from pressure and entropy;
•Function(Psat,x) – to calculate properties from pressure and quality, for saturated steam and liquid and two fases;
•Function(Tsat,x) – to calculate  properties from saturated temperature and quality, for saturated steam and liquid and two fases;
•Function(h,s) – to calculate properties from entalpy and entropy.

From the functions above, you can calculate quickly the properties below:

MAIN THERMODYNAMIC PROPERTIES:
•Pressure;
•Temperature;
•Enthalpy;
•Entropy;
•Vapor Fraction;
•Specific Volume;
•Internal Energy;
•Density;
•Region;

OTHER THERMODYNAMICA PROPERTIES:
•Specific Isobaric Heat Capacity (Cp);
•Specific Isochoric Heat Capacity (Cv);
•Speed of Sound;
•Kappa;
•Vapor Volume Fraction.

TRANSPORT PROPERTIES:
•Dynamic Viscosity;
•Kinematic Viscosity;
•Prandtl;
•Surface Tension;
•Thermal Conductivity.

